import React, {useState} from 'react';
import Input from '../utils/Input/Input';
import "./registration.css"
import {registration} from "../../action/user"

const Registration = () => {
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")

    return (
        <div className='registration'>
            <div className='registration__header'> Registration </div>
            <Input value={email} setValue={setEmail} type='text' placeholder = "Write your email address"/>
            <Input value={password} setValue={setPassword} type='text' placeholder = "Write your password"/>
            <Input type='text' placeholder = ""/>
            <Input type='text' placeholder = ""/>
            <button className="registration__btn" onClick={() => registration(email, password)}>Registration</button>
        </div>
    );
};

export default Registration;
